/**
  * @brief  The application entry point.
  * @retval int
  */
int main(void)
{
  /* USER CODE BEGIN 1 */

  /* USER CODE END 1 */

  /* MCU Configuration--------------------------------------------------------*/

  /* Reset of all peripherals, Initializes the Flash interface and the Systick. */
  HAL_Init();

  /* USER CODE BEGIN Init */

  /* USER CODE END Init */

  /* Configure the system clock */
  SystemClock_Config();

  /* USER CODE BEGIN SysInit */

  /* USER CODE END SysInit */

  /* Initialize all configured peripherals */
  MX_GPIO_Init();
  MX_DMA_Init();
  MX_ADC1_Init();
  MX_I2S3_Init();
  /* USER CODE BEGIN 2 */

  HAL_ADC_Start(&hadc1);
  HAL_ADC_PollForConversion(&hadc1, 10);

  uint16_t adcX_Centre = HAL_ADC_GetValue(&hadc1);

  ADC_ChannelConfTypeDef sConfig = {0};

  sConfig.Channel = ADC_CHANNEL_15;
  sConfig.Rank = 1;
  sConfig.SamplingTime = ADC_SAMPLETIME_3CYCLES;
  if (HAL_ADC_ConfigChannel(&hadc1, &sConfig) != HAL_OK)
  {
    Error_Handler();
  }

  HAL_ADC_Start(&hadc1);
  HAL_ADC_PollForConversion(&hadc1, 10);

  uint16_t adcY_Centre = HAL_ADC_GetValue(&hadc1);

  uint16_t adcX_Current = 0;
  uint16_t adcY_Current = 0;

  LDRSprites(spritemem);
  BitBlit(Screen_Start, FindSprite(spritemem, INV2), xPos, yPos, INV2_W, INV2_H);

  uint8_t wasAtWall = 0;
  uint8_t atSideWall = 0;
  uint8_t atBottomOrTopWall = 0;
  /* USER CODE END 2 */

  /* Infinite loop */
  /* USER CODE BEGIN WHILE */
  while (1)
  {
	  sConfig.Channel = ADC_CHANNEL_14;
	  sConfig.Rank = 1;
	  sConfig.SamplingTime = ADC_SAMPLETIME_3CYCLES;
	  if (HAL_ADC_ConfigChannel(&hadc1, &sConfig) != HAL_OK)
	  {
	    Error_Handler();
	  }
	  HAL_ADC_Start(&hadc1);
	  HAL_ADC_PollForConversion(&hadc1, 10);

	  adcX_Current = HAL_ADC_GetValue(&hadc1);

	  sConfig.Channel = ADC_CHANNEL_15;
	  sConfig.Rank = 1;
	  sConfig.SamplingTime = ADC_SAMPLETIME_3CYCLES;
	  if (HAL_ADC_ConfigChannel(&hadc1, &sConfig) != HAL_OK)
	  {
	    Error_Handler();
	  }
	  HAL_ADC_Start(&hadc1);
	  HAL_ADC_PollForConversion(&hadc1, 10);

	  adcY_Current = HAL_ADC_GetValue(&hadc1);


	  // Calculate distance to travel
	  dX = ((adcX_Current-adcX_Centre)/205);
	  dY = ((adcY_Current-adcY_Centre)/205);


	  ClearSprite(Screen_Start, xPos, yPos, INV2_W, INV2_H);

	  xPos += dX;
	  yPos += dY;

	  // Clamp screen coordinates
	  if (xPos < 0) {
		  xPos = 0;
		  if (atSideWall) {
			  wasAtWall = 1;
		  }
		  else {
			  atSideWall = 1;
			  wasAtWall = 0;
		  }
	  }
	  else if (xPos >= 320 - INV2_W) {
		  xPos = 320 - INV2_W;
		  if (atSideWall) {
			  wasAtWall = 1;
		  }
		  else {
			  atSideWall = 1;
			  wasAtWall = 0;
		  }
	  }
	  else {
		  atSideWall = 0;
	  }
	  if (yPos < 0) {
		  yPos = 0;
		  if (atBottomOrTopWall) {
			  wasAtWall = 1;
		  }
		  else {
			  atBottomOrTopWall = 1;
			  wasAtWall = 0;
		  }
	  }
	  else if (yPos >= 200 - INV2_H) {
		  yPos = 200 - INV2_H;
		  if (atBottomOrTopWall) {
			  wasAtWall = 1;
		  }
		  else {
			  atBottomOrTopWall = 1;
			  wasAtWall = 0;
		  }
	  }
	  else {
		  atBottomOrTopWall = 0;
	  }

	  BitBlit(Screen_Start, FindSprite(spritemem, INV2), xPos, yPos, INV2_W, INV2_H);

	  if ((atBottomOrTopWall || atSideWall) && !wasAtWall) {
		  playCollisionSound();
	  }


    /* USER CODE END WHILE */

    /* USER CODE BEGIN 3 */
  }
  /* USER CODE END 3 */
}

